var Roblox=Roblox||{};Roblox.Lang=Roblox.Lang||{};Roblox.Lang['Feature.Landing']={"Action.Cancel":"Batalkan","Action.Continue":"Lanjutkan","Action.LogIn":"Log In","Description.ExternalWebsiteRedirect":"Perhatian Robloxian, dengan mengklik \"Lanjutkan\", kamu akan diarahkan ke situs web yang tidak dimiliki atau dijalankan oleh Roblox. Situs web ini mungkin memiliki ketentuan dan kebijakan privasi yang berbeda.","Description.RobloxOnDeviceParagraphOne":"Roblox dapat diakses melalui semua jenis ponsel pintar modern, desktop, Xbox One, Oculus Rift, dan akan segera dapat diakses melalui Daydream dan Cardboard. Petualangan Roblox dapat diakses dari perangkat apa pun sehingga pemain dapat berimajinasi dengan teman-temannya di mana pun mereka berada.","Description.RobloxOnDeviceParagraphTwo":"Roblox dapat diakses di PC, Mac, iOS, Android, Perangkat Amazon, dan Xbox One. Petualangan Roblox dapat diakses dari perangkat apa pun agar pemain dapat berimajinasi dengan teman mereka dari mana saja.","Description.WhatIsRobloxParagraphOne":"Roblox membantu memberdayakan imajinasi orang-orang di seluruh dunia. Sebagai platform pengalaman virtual sosial yang paling besar dan berkembang pesat, lebih dari 44 juta orang datang ke Roblox setiap bulan untuk menciptakan petualangan, bermain game, bermain peran, dan belajar bersama dengan teman. Kami menyebutnya dengan \"Platform Imajinasi\".","Heading.LeavingRoblox":"Kamu keluar dari Roblox","Heading.RobloxOnDevice":"Roblox di Perangkat Kamu","Heading.WhatIsRoblox":"Apa itu Roblox?","Heading.WhatIsRobloxParagraphTwo":"Roblox merupakan tempat terbaik untuk Berimajinasi dengan Teman. Sebagai platform pengalaman virtual buatan pengguna terbesar dan lebih dari 15 juta pengalaman virtual yang dibuat oleh pengguna, Roblox adalah situs nomor satu untuk anak dan remaja (comScore). Setiap hari penjelajah virtual datang ke Roblox untuk menciptakan petualangan, bermain game, bermain peran, dan belajar bersama dengan teman mereka di lingkungan yang ramah keluarga dan imersif.","Label.About":"Tentang","Label.BrazilContentRatingLogoSubtitle":"Pembelian online","Label.BrazilContentRatingLogoTitle":"Panduan rating: 10 tahun","Label.GetOnGooglePlay":"Dapatkan di Google Play","Label.ItalyContentRatingLogoTitle":"Pembelian Dalam Pengalaman Virtual (Termasuk Item Acak)","Label.MetaQuestStoreRobloxApp":"Roblox di Meta Quest","Label.Platforms":"Platform","Label.Play":"Mainkan","Label.PlayStationStoreRobloxApp":"Roblox di Playstation","Label.RobloxAmazonStore":"Roblox di Amazon Store","Label.RobloxAppStore":"Roblox di App Store","Label.RobloxOnXbox":"Roblox di Xbox Store","Label.RobloxWindowsStore":"Roblox di Windows Store","Link.AmazonStoreRobloxApp":"https://www.amazon.com/Roblox-Corporation/dp/B00NUF4YOA","Link.AppleAppStoreRobloxApp":"https://itunes.apple.com/us/app/roblox-mobile/id431946152","Link.GooglePlayStoreRobloxApp":"https://play.google.com/store/apps/details?id=com.roblox.client&hl=id&gl=ID","Link.MetaQuestStoreRobloxApp":"https://www.meta.com/experiences/5804350719675181/","Link.PlayStationStoreRobloxAppV2":"https://www.playstation.com/en-id/games/roblox/?country-selector=true","Link.WindowsStoreRobloxApp":"https://www.xbox.com/id-id/games/store/roblox/9nblgggzm6wm","Link.XboxStoreRobloxApp":"https://www.xbox.com/id-id/games/store/roblox/bq1tn1t79v9k"};Roblox.Lang['LandingResources']=Roblox.Lang['Feature.Landing'];

